INSERT INTO `ADVERTISEMENT` VALUES ('2', '终极救市王炸出炉：央行将为市场提供流动性', '/BBCall/ADupload/2015070639sUJixtpv28f7uB.jpg', '/BBCall/ADupload/20150706bTuw9q3voEe8klAK.jpg', '16001', '证监会晚间发布：央行将给予证金公司流动性支持。', '<p style=\"margin-top: 0px; margin-bottom: 29px; padding: 0px; line-height: 28px; font-family: 宋体, Arial, sans-serif; font-size: 15.9995994567871px; white-space: normal; text-indent: 2em; background-color: rgb(255, 255, 255);\">公告内容如下：为了维护股票市场稳定，中国证监会决定，充分发挥中国证券金融股份有限公司（下称证金公司）的作用，多渠道筹集资金，扩大业务规模，增强维护市场稳定的能力。中国人民银行将协助通过多种形式给予中国证券金融股份有限公司流动性支持。</p><p style=\"margin-top: 0px; margin-bottom: 29px; padding: 0px; line-height: 28px; font-family: 宋体, Arial, sans-serif; font-size: 15.9995994567871px; white-space: normal; text-indent: 2em; background-color: rgb(255, 255, 255);\">目前央行网站尚无此消息。</p><p style=\"margin-top: 0px; margin-bottom: 29px; padding: 0px; line-height: 28px; font-family: 宋体, Arial, sans-serif; font-size: 15.9995994567871px; white-space: normal; text-indent: 2em; background-color: rgb(255, 255, 255);\">根据章程，证金公司负责为券商两融业务提供转融通服务，并可直接买卖股票。</p><p style=\"margin-top: 0px; margin-bottom: 29px; padding: 0px; line-height: 28px; font-family: 宋体, Arial, sans-serif; font-size: 15.9995994567871px; white-space: normal; text-indent: 2em; background-color: rgb(255, 255, 255);\">作为券商救市的后盾，证金公司未来将获得央行提供的流动性支持，这意味着在某种程度上，央行将为救市行动提供终极支持，并在行动中保持了相当的灵活性。</p><p style=\"margin-top: 0px; margin-bottom: 29px; padding: 0px; line-height: 28px; font-family: 宋体, Arial, sans-serif; font-size: 15.9995994567871px; white-space: normal; text-indent: 2em; background-color: rgb(255, 255, 255);\"><a class=\"a-tips-Article-QQ\" href=\"http://gu.qq.com/sh601688\" target=\"_blank\" style=\"outline: none; color: rgb(0, 0, 0); text-decoration: none; border-bottom-width: 1px; border-bottom-style: dotted; border-bottom-color: rgb(83, 109, 166);\">华泰证券</a>研究所金融首席分析师罗毅对腾讯证券表示，这一做法，确实是救市大招。证金公司刚刚完成增资，继续启动资金杠杆开展业务，央行为其提供流动性支持，可以快速帮助证金公司在救市行动中发挥作用。</p><p style=\"margin-top: 0px; margin-bottom: 29px; padding: 0px; line-height: 28px; font-family: 宋体, Arial, sans-serif; font-size: 15.9995994567871px; white-space: normal; text-indent: 2em; background-color: rgb(255, 255, 255);\">7月3日，中国证监会决定，证金公司进行第三次增资扩股，由现有股东进行增资，将现有注册资本从240亿元增资到约1000亿元。增资扩股后，证金公司还将多渠道筹集资金，用于扩大业务规模，维护资本市场稳定。</p><p style=\"margin-top: 0px; margin-bottom: 29px; padding: 0px; line-height: 28px; font-family: 宋体, Arial, sans-serif; font-size: 15.9995994567871px; white-space: normal; text-indent: 2em; background-color: rgb(255, 255, 255);\">证金公司成立于2011年10月28日，是中国境内唯一从事转融通业务的金融机构，旨在为证券公司融资融券业务提供配套服务。其股东单位有：上海证券交易所、深圳证券交易所、上海期货交易所、中国证券登记结算有限责任公司、中国金融期货交易所、大连商品交易所和郑州商品交易所。</p><p style=\"margin-top: 0px; margin-bottom: 29px; padding: 0px; line-height: 28px; font-family: 宋体, Arial, sans-serif; font-size: 15.9995994567871px; white-space: normal; text-indent: 2em; background-color: rgb(255, 255, 255);\">罗毅指出，未来央行给予证金公司流动性支持的方式可能多种多样，使用定向支持工具、在银行间市场开辟额外通道等，都是可选项。而证金公司未来影响市场的方式，可能主要还是通过支持券商开展融资融券业务，同时不排除证金公司直接入市的可能。理论上，证监会不禁止的业务，证金公司都可参与。</p><p style=\"margin-top: 0px; margin-bottom: 29px; padding: 0px; line-height: 28px; font-family: 宋体, Arial, sans-serif; font-size: 15.9995994567871px; white-space: normal; text-indent: 2em; background-color: rgb(255, 255, 255);\">复旦大学金融研究中心主任孙立坚认为，央行与证金公司这一组合存在多种可能性，不排除证金公司成立平准<a href=\"http://stock1.finance.qq.com/fund/index.htm\" target=\"_blank\" style=\"outline: none; color: rgb(0, 0, 0); text-decoration: none; border-bottom-width: 1px; border-bottom-style: dotted; border-bottom-color: rgb(83, 109, 166);\">基金</a>，央行负责注资。采用何种干预工具，可视市场的多空博弈，灵活选择。同时孙立坚认为，实际上央行可能不会动用大额资金，资本凭借自己的嗅觉会自己做出调整。</p><p style=\"margin-top: 0px; margin-bottom: 29px; padding: 0px; line-height: 28px; font-family: 宋体, Arial, sans-serif; font-size: 15.9995994567871px; white-space: normal; text-indent: 2em; background-color: rgb(255, 255, 255);\">国家信息中心首席经济师范剑平的看法与孙立坚类似，他分析称，华尔街有句格言，不要和美联储作对。不要过早把底牌亮给空方，其实谁都知道央行不会提供无限额度。单政府稳定市场的决心已明朗，空头自然会退，其实不用恶战，花不了多少流动性。需要注意的是，不能反手被多头利用。</p><p style=\"margin-top: 0px; margin-bottom: 29px; padding: 0px; line-height: 28px; font-family: 宋体, Arial, sans-serif; font-size: 15.9995994567871px; white-space: normal; text-indent: 2em; background-color: rgb(255, 255, 255);\">民族证券宏观分析师朱启民表示，央行通过多种形式给予证金公司流动性支持，这是决定性的一击！意味着理论上有无限的弹药救市，市场止跌是必然。</p><p style=\"margin-top: 0px; margin-bottom: 29px; padding: 0px; line-height: 28px; font-family: 宋体, Arial, sans-serif; font-size: 15.9995994567871px; white-space: normal; text-indent: 2em; background-color: rgb(255, 255, 255);\"><a class=\"a-tips-Article-QQ\" href=\"http://gu.qq.com/sh600030\" target=\"_blank\" style=\"outline: none; color: rgb(0, 0, 0); text-decoration: none; border-bottom-width: 1px; border-bottom-style: dotted; border-bottom-color: rgb(83, 109, 166);\">中信证券</a>首席经济学家诸建芳则认为，这表明了中央的立场，坚决维护资本市场稳定，有利于平复市场恐慌情绪，给投资者以信心。此外，央行未披露具体金额，说明这一流动性支持是开放性的，证金公司维护市场稳定需要多少资金都能从央行获得支持，对于市场来说可谓最大的利好。</p><p style=\"margin-top: 0px; margin-bottom: 29px; padding: 0px; line-height: 28px; font-family: 宋体, Arial, sans-serif; font-size: 15.9995994567871px; white-space: normal; text-indent: 2em; background-color: rgb(255, 255, 255);\">证金公司成立于2011年10月28日，是中国境内唯一从事转融通业务的金融机构，旨在为证券公司融资融券业务提供配套服务。其股东单位有：上海证券交易所、深圳证券交易所、上海期货交易所、中国证券登记结算有限责任公司、中国金融期货交易所、大连商品交易所和郑州商品交易所。</p><p style=\"margin-top: 0px; margin-bottom: 29px; padding: 0px; line-height: 28px; font-family: 宋体, Arial, sans-serif; font-size: 15.9995994567871px; white-space: normal; text-indent: 2em; background-color: rgb(255, 255, 255);\">截至2015年3月底，证券公司融资融券累计交易额23.5万亿元，日交易额达A股交易额的18%，融资融券余额达到14939.2亿元，占A股流通市值的3.8%。沪深市场标的证券为918只，开展融资融券业务的证券公司达到91家，投资者数量达到330万人。</p><p style=\"text-align: center;\"><img src=\"/BBCall/ADupload/image/20150706/1436121752878054531.png\" title=\"1436121752878054531.png\" alt=\"83025aafa40f4bfbdcba6011034f78f0f7361808.png\"/></p>', '2015-07-06 02:42:45', '1', '1'), ('3', '收评:沪指涨4.54%现4连阳 两市近1300股涨停', '/BBCall/ADupload/20150710WZbH7L6vIfzyMbg8.png', '/BBCall/ADupload/20150710DWbis1YoHO3i8684.jpg', '14003', '截至收盘，沪指报3877.80点，涨168.47点，涨幅4.54%，深成指报12038.14，涨527.80点，涨幅4.59%点.', '<p style=\"margin-top: 15px; margin-bottom: 15px; padding: 0px; font-size: 14px; line-height: 23px; color: rgb(51, 51, 51); font-family: 宋体; white-space: normal; background-color: rgb(255, 255, 255);\">新浪财经讯 周五早盘，两市开盘不一，沪指小幅低开后，下探迅速拉升，一路冲破3800、3900点两关口，10点50左右冲高回落，临近午盘，涨幅有所回落，午后开盘，沪指小幅回，之后在3900上下高位震荡，盘面上，题材股活跃，两市逾1300股涨停，板块集体飘红，临近盘尾，涨幅缩小。</p><p style=\"margin-top: 15px; margin-bottom: 15px; padding: 0px; font-size: 14px; line-height: 23px; color: rgb(51, 51, 51); font-family: 宋体; white-space: normal; background-color: rgb(255, 255, 255);\">　　截至收盘，沪指报3877.80点，涨168.47点，涨幅4.54%，成交6804.34亿，深成指报12038.14，涨527.80点，涨幅4.59%点，成交2473.29亿，创业板指报2535.89点，涨100.14点，涨幅4.11%，成交456.43亿。</p><p style=\"margin-top: 15px; margin-bottom: 15px; padding: 0px; font-size: 14px; line-height: 23px; color: rgb(51, 51, 51); font-family: 宋体; white-space: normal; background-color: rgb(255, 255, 255);\">　　板块方面，港口、家电、航天航空、军工涨幅靠前，石油、保险、房地产涨幅靠后。</p><p style=\"margin-top: 15px; margin-bottom: 15px; padding: 0px; font-size: 14px; line-height: 23px; color: rgb(51, 51, 51); font-family: 宋体; white-space: normal; background-color: rgb(255, 255, 255);\">　　新浪财经首席评论员老艾<a class=\"wt_article_link\" href=\"http://weibo.com/aitangming?zw=finance\" target=\"_blank\" style=\"color: rgb(61, 108, 176); text-decoration: none;\">[微博]</a>表示，连续第二天千股涨停，这已经不是超跌反弹这么简单了，种种迹象表明，牛市已在复苏的道路上。牛市诞生的核心因素没有改变，导致本轮大跌的杠杆威胁也已解决，牛市必然会重新回到上升趋势中来，再次收复5000点也不是没有可能。而对于个股来说，虽然连续两天涨停，但和近期跌幅相比，上涨空间仍然巨大，下周虽然有可能冲高回落，但后市仍然是以买为主，等待一步步收复失地。(<a href=\"http://finance.sina.com.cn/zl/stock/20150710/163622651697.shtml\" target=\"_blank\" style=\"color: rgb(93, 127, 162); text-decoration: none;\">点击阅读全文</a>)</p><p style=\"text-align:center\"><br/></p><p style=\"margin-top: 15px; margin-bottom: 15px; padding: 0px; font-size: 14px; line-height: 23px; color: rgb(51, 51, 51); font-family: 宋体; white-space: normal; background-color: rgb(255, 255, 255);\">　<strong>　后市展望：</strong></p><p style=\"margin-top: 15px; margin-bottom: 15px; padding: 0px; font-size: 14px; line-height: 23px; color: rgb(51, 51, 51); font-family: 宋体; white-space: normal; background-color: rgb(255, 255, 255);\">　　今日，指数继续高歌，个股再现涨停局面，此情此景，百年罕见。值得注意的是，昨日指数已经企稳，而今日市场再传利好，救市步伐仍在延续。可以说，直至今日，国家救市取得阶段性的胜利，阶段性稳定有望就此形成。全天看，买盘力量继续增加，但涨停个股有打开迹象，表明短期获利抛盘有出货嫌疑。而从历来市场走势看，反弹都不是一蹴而就的，特别是暴跌后的反弹，必然要经历反复的筑底。</p><p style=\"margin-top: 15px; margin-bottom: 15px; padding: 0px; font-size: 14px; line-height: 23px; color: rgb(51, 51, 51); font-family: 宋体; white-space: normal; background-color: rgb(255, 255, 255);\">　　因此，巨丰投顾郭一鸣认为，指数阶段底部逐步形成，后期总体反弹行情可期，但指数反弹中还有多次探底可能，切不可盲目重仓做多。在超跌反弹的当下，针对不同情况，做具体操作：首先，如果是近期底部抄底的，短期务必获利出局，等待二次探底；其次，前期重仓套牢的，借反弹减仓做差；再有，轻仓观望的，可逐步加仓，但要以再次大跌为介入点；总体上，两市中期向好情绪依旧，可重点关注具有业绩支撑的超跌个股，而对前期股东大幅减持的相关个股，中线可加大买进力度。</p><p style=\"margin-top: 15px; margin-bottom: 15px; padding: 0px; font-size: 14px; line-height: 23px; color: rgb(51, 51, 51); font-family: 宋体; white-space: normal; background-color: rgb(255, 255, 255);\">　　分析师表示，两市停牌个股仍超半数，其携带的强制平仓压力暂被隐藏，若密集复牌恐再次对市场造成较大冲击。目前看，“救市”已取得实质性进展，但尚不能确认触底反弹的大趋势。建议投资者谨慎参与短线抢反弹行情，可重点挖掘穿越牛熊的优质价值股(业绩+估值+成长空间/政策驱动)，考虑逐步介入。</p><p style=\"margin-top: 15px; margin-bottom: 15px; padding: 0px; font-size: 14px; line-height: 23px; color: rgb(51, 51, 51); font-family: 宋体; white-space: normal; background-color: rgb(255, 255, 255);\">　　天信投资：本轮牛市重要的动力是加杠杆，而近期的连续杀跌同样是杠杆的强制平仓。数据显示融资余额的峰值出现在6月18日，彼时沪深两市融资余额为2.26万亿元。截至7月8日，融资余额为1.456万亿元。我们可以看到近期的连续杀跌，市场的杠杆水平已经有了明显的下降，下跌是降杠杆最好的灵丹妙药。融资盘去杠杆的风险彻底释放，市场不用再担忧1.4万亿融资余额的爆仓风险，同样说明接下来的市场会是非常健康、稳健的上涨！</p><p style=\"margin-top: 15px; margin-bottom: 15px; padding: 0px; font-size: 14px; line-height: 23px; color: rgb(51, 51, 51); font-family: 宋体; white-space: normal; background-color: rgb(255, 255, 255);\">　　对于救市后的市场，仍需要自我消化，自我修复。融资盘的平仓已经进行了十几天，高峰压力已经接近尾声。两融的规模已经下来，待市场恐慌情绪稳定住，市场已经企稳。在对未来有信心、坚定看多的前提下，理性也告诉我们，现在格局在朝着企稳的方向进展，但是形成单边反弹的可能性依然不大，更可能是在此区域稳住盘整，逐步化解危机带来的冲击，之后才有望迎来真正的反弹行情。同时，随着资金去杠杆的发展，暴涨暴跌行情将会慢慢远去，在充分调整后，慢牛行情将会逐步到来。这个时候无论是何种股票都比较亢奋，普涨的时代短期到来，无需推荐，持仓的积极补仓，空仓的找熟悉的个股积极介入！</p><p><br/></p>', '2015-07-10 17:21:31', '1', '0'), ('9', 'test123456', '/BBCall/ADupload/201507159QnzWf1WRxQfhKKB.jpg', '/BBCall/ADupload/20150715fUGWilOrFKouyhkI.jpg', '18001', 'test123456test123456test123456', '<p>test123456test123456</p><p>test123456</p><p>test123456</p><p><img src=\"/BBCall/ADupload/image/20150715/1436898564191042166.jpg\" title=\"1436898564191042166.jpg\" alt=\"6275348_092352193000_2.jpg\"/></p>', '2015-07-15 02:29:31', '1', '1'), ('10', '123456778', '/BBCall/ADupload/20150716kCXBkfQdqfEgm5xM.jpg', '/BBCall/ADupload/20150716EvQ2qQo8YnnrXJaw.jpg', '16003', 'qwertqwrwedasf', '<p>在這裡輸入廣告內容 (Enter AD contents here)</p><p>asdhauisnasjdfaoswuhfsaudif</p>', '2015-07-16 01:51:32', '0', '0'), ('15', 'zxcvzxcv', '/BBCall/ADupload/20150716diEwQUjpxObdiDzQ.jpg', '/BBCall/ADupload/201507162Xe66jur6ianvNWF.png', '13003', 'zxcvzxcv', '<p>在這裡輸入廣告內容 (Enter AD contents here)</p><p>zxczxc</p>', '2015-07-16 02:23:27', '0', '1'), ('16', 'asdfdgasdf', '/BBCall/ADupload/20150716VdExmOAmchB4cB7D.jpg', '/BBCall/ADupload/20150716NN0nWhRhCHBdH8Y9.jpg', '22004', 'asdgasdfhsdg', '<p>在這裡輸入廣告內容 (Enter AD contents here)</p>', '2015-07-16 02:24:05', '0', '1');
COMMIT;

