DROP TABLE IF EXISTS `USERSKILL`;
CREATE TABLE `USERSKILL` (
  `userskill_id` int(11) NOT NULL AUTO_INCREMENT,
  `user_id` int(11) NOT NULL,
  `user_skill` int(11) NOT NULL,
  `user_skill_url` varchar(255) NOT NULL,
  `user_skill_status` tinyint(4) DEFAULT '0',
  `user_skill_create_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  PRIMARY KEY (`userskill_id`),
  KEY `user_id` (`user_id`),
  CONSTRAINT `userskill_ibfk_1` FOREIGN KEY (`user_id`) REFERENCES `USER` (`user_id`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=5 DEFAULT CHARSET=utf8;

